$(document).ready(function () {
  var x = $(document).scrollTop(0);
  $(document).scroll(function () {
    var y = $(document).scrollTop();
    var z = y - x;

    if (y >= 300 && z >= 0) {
      $("div:nth-child(1)").stop().animate({
        marginLeft: "300px"
      });
    }

    if (y >= 1200 && z >= 0) {
      $("div:nth-child(2)").stop().animate({
        marginLeft: "300px"
      });
    }

    if (y >= 2000 && z >= 0) {
      $("div:nth-child(3)").stop().animate({
        marginLeft: "300px"
      });
    }

    if (y < 600 && z < 0) {
      $("div:nth-child(1)").stop().animate({
        marginLeft: "0"
      });
    }

    if (y < 1500 && z < 0) {
      $("div:nth-child(2)").stop().animate({
        marginLeft: "0"
      });
    }

    if (y < 2300 && z < 0) {
      $("div:nth-child(3)").stop().animate({
        marginLeft: "0"
      });
    }

    x = y;
    $("p").text("y: " + Math.round(y) + " , z: " + Math.round(z));
  });
});
